  private async generateGemini(messages: AIMessage[]): Promise<AIResponse> {
    const apiKey = await this.ensureApiKey("Gemini");
    const genAI = new GoogleGenAI({ apiKey });

    const systemMessage = messages.find(m => m.role === "system");
    const conversationText = messages
      .filter(m => m.role !== "system")
      .map(m => `${m.role === "user" ? "User" : "Assistant"}: ${m.content}`)
      .join("\n\n");

    const prompt = systemMessage 
      ? `${systemMessage.content}\n\n${conversationText}`
      : conversationText;

    const response = await genAI.models.generateContent({
      model: this.settings.model || "gemini-2.0-flash-001",
      contents: prompt,
    });

    const content = response.text || "";

    // Приблизительная оценка токенов
    const tokensUsed = {
      prompt: AIService.estimateTokens(prompt),
      completion: AIService.estimateTokens(content),
      total: AIService.estimateTokens(prompt) + AIService.estimateTokens(content),
    };

    // Примерная стоимость (Gemini pricing очень низкая)
    const cost = tokensUsed.total * 0.0000015; // $0.0015 per 1K tokens

    return buildAIResponse(content, 0.85, tokensUsed, cost);
  }

  private async generateGrok(messages: AIMessage[]): Promise<AIResponse> {
    if (!this.settings.apiKey) {
      throw new Error("xAI API key not configured");
    }

    const response = await fetch("https://api.x.ai/v1/chat/completions", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        "Authorization": `Bearer ${this.settings.apiKey}`,
      },
      body: JSON.stringify({
        model: this.settings.model || "grok-beta",
        messages: messages,
        temperature: this.settings.temperature || 0.7,
        max_tokens: this.settings.maxTokens || 2000,
      }),
    });

    if (!response.ok) {
      throw new Error(`Grok API error: ${response.statusText}`);
    }

    const data = await response.json();
    const content = data.choices[0]?.message?.content || "";
    const confidence = data.choices[0]?.finish_reason === "stop" ? 0.9 : 0.6;

    // Получаем информацию о токенах если доступна
    const tokensUsed = data.usage ? {
      prompt: data.usage.prompt_tokens,
      completion: data.usage.completion_tokens,
      total: data.usage.total_tokens,
    } : {
      // Приблизительная оценка если usage не доступен
      prompt: AIService.estimateTokens(JSON.stringify(messages)),
      completion: AIService.estimateTokens(content),
      total: AIService.estimateTokens(JSON.stringify(messages)) + AIService.estimateTokens(content),
    };

    // Примерная стоимость (Grok pricing: примерно как GPT-4)
    const cost = (tokensUsed.prompt * 0.03 / 1000) + (tokensUsed.completion * 0.06 / 1000);

    return { content, confidence, tokensUsed, cost };
  }

