// Конструктор PDFParse из pdf-parse@2.x
type PdfParseCtor = new (opts: { data?: Uint8Array; url?: string }) => {
  getText: () => Promise<{ text?: string }>;
  destroy?: () => Promise<void>;
};

let pdfParsePromise: Promise<PdfParseCtor> | null = null;

// Ленивая загрузка класса PDFParse (ESM-энтрипоинт pdf-parse)
async function loadPdfParseClass(): Promise<PdfParseCtor> {
  if (!pdfParsePromise) {
    pdfParsePromise = (async () => {
      const mod = await import("pdf-parse");
      const PDFParse = (mod as { PDFParse?: PdfParseCtor }).PDFParse;
      if (!PDFParse) {
        throw new TypeError("PDFParse class not found in pdf-parse exports");
      }
      return PDFParse;
    })();
  }
  return pdfParsePromise;
}

/**
 * Скачивает PDF по URL и возвращает извлечённый текст (все страницы).
 */
export async function pdfUrlToText(pdfUrl: string): Promise<string> {
  const res = await fetch(pdfUrl);
  if (!res.ok) {
    throw new Error(`Failed to download PDF: ${res.status} ${res.statusText}`);
  }

  const arrayBuffer = await res.arrayBuffer();
  const data = new Uint8Array(arrayBuffer);

  const PDFParse = await loadPdfParseClass();
  const parser = new PDFParse({ data });

  try {
    const { text = "" } = await parser.getText();
    return text;
  } finally {
    await parser.destroy?.();
  }
}

