Да, понимаю. Тебе нужно именно **API-уровневое Structured Output**: модель возвращает JSON строго по схеме, внутри которого есть `is_receipt` и `receipt_confidence`, плюс поля самого чека.

Ниже — как это описать и дернуть из Node.

---

## 1. Логическая модель (что мы хотим от модели)

Тип результата (в терминах TS):

```ts
export interface ReceiptResult {
  amount: number | null;
  currency: 'RUB' | 'USD' | 'EUR' | 'KZT' | 'BYN' | null;
  date_time: string | null;      // ISO-дата/время или null
  merchant: string | null;
  purpose: string | null;
  operation_id: string | null;
  payer_account: string | null;
}

export interface ReceiptExtraction {
  thinking: string;              // краткое объяснение (для логов)
  is_receipt: boolean;           // чек или нет
  receipt_confidence: number;    // 0..1, уверенность "это чек"
  result: ReceiptResult;
}
```

---

## 2. JSON Schema для Structured Output (response_format)

Это кусок, который кладётся в `response_format` для **chat.completions** (или Responses API) и заставляет `gpt-4o-mini` / `gpt-4o-2024-08-06` возвращать ровно такой JSON.([OpenAI Cookbook][1])

```ts
// server/services/ai/receiptSchema.ts
export const receiptResponseFormat = {
  type: 'json_schema',
  json_schema: {
    name: 'receipt_extraction',
    strict: true, // включает Structured Outputs: ответ обязан соответствовать схеме
    schema: {
      type: 'object',
      properties: {
        thinking: {
          type: 'string',
          description:
            'Short explanation why this is or is not a receipt. Target length: 1-3 sentences.',
        },
        is_receipt: {
          type: 'boolean',
          description:
            'True if the input represents a payment or purchase receipt (including electronic receipts, transaction slips, payment confirmations). False otherwise.',
        },
        receipt_confidence: {
          type: 'number',
          minimum: 0,
          maximum: 1,
          description:
            'Model confidence that the input is a receipt, between 0 and 1.',
        },
        result: {
          type: 'object',
          properties: {
            amount: {
              type: 'number',
              description:
                'Total amount paid on the receipt, without currency. Omit if you cannot reliably determine it.',
            },
            currency: {
              type: 'string',
              enum: ['RUB', 'USD', 'EUR', 'KZT', 'BYN'],
              description:
                'Currency of the operation, as a 3-letter code. Omit if unknown.',
            },
            date_time: {
              type: 'string',
              description:
                'ISO 8601 datetime if possible (e.g. "2024-01-31T13:25:00"), or just date "2024-01-31". Omit if unknown.',
            },
            merchant: {
              type: 'string',
              description:
                'Name of the merchant / shop / organization issuing the receipt.',
            },
            purpose: {
              type: 'string',
              description:
                'Short description of the purchase or payment purpose, in Russian.',
            },
            operation_id: {
              type: 'string',
              description:
                'Transaction / operation / check number if present.',
            },
            payer_account: {
              type: 'string',
              description:
                'Masked payer account/card number if present (e.g. "**** 1234").',
            },
          },
          // Ничего лишнего:
          additionalProperties: false,
          // Здесь можно вообще не указывать required, чтобы модель могла опускать поля.
          // required: ['amount', 'currency', 'date_time', ...] // если хочешь жёстко требовать
        },
      },
      required: ['is_receipt', 'receipt_confidence', 'result'],
      additionalProperties: false,
    },
  },
} as const;
```

Замечания:

* `strict: true` — это ключ, который включает **Strict Structured Outputs**, гарантируя, что JSON соответствует схеме.([OpenAI Cookbook][1])
* Поля, которые могут быть `null`, обычно делают **опциональными** (модель просто не заполняет их), а уже в своём коде можно подставлять `null` по дефолту.

---

## 3. Вызов модели (Node + chat.completions)

Пример, который берёт **текст и/или картинку чека** и возвращает `ReceiptExtraction`.

```ts
// server/services/ai.ts
import OpenAI from 'openai';
import type {
  ChatCompletionMessageParam,
} from 'openai/resources/chat/completions';

import { receiptResponseFormat } from './receiptSchema';

const openai = new OpenAI({ apiKey: process.env.OPENAI_API_KEY! });

export interface AnalyzeReceiptInput {
  text?: string;
  imageUrl?: string;
}

export interface ReceiptResult {
  amount: number | null;
  currency: 'RUB' | 'USD' | 'EUR' | 'KZT' | 'BYN' | null;
  date_time: string | null;
  merchant: string | null;
  purpose: string | null;
  operation_id: string | null;
  payer_account: string | null;
}

export interface ReceiptExtraction {
  thinking: string;
  is_receipt: boolean;
  receipt_confidence: number;
  result: ReceiptResult;
}

export async function analyzeReceipt(
  input: AnalyzeReceiptInput,
): Promise<ReceiptExtraction> {
  const userContent: any[] = [];

  if (input.text) {
    userContent.push({ type: 'text', text: input.text });
  }

  if (input.imageUrl) {
    userContent.push({
      type: 'image_url',
      image_url: {
        url: input.imageUrl,
      },
    });
  }

  const messages: ChatCompletionMessageParam[] = [
    {
      role: 'system',
      content:
        'You are a receipt extraction engine. Decide whether the input is a receipt and, if yes, extract its fields. Always answer strictly in JSON following the provided schema.',
    },
    {
      role: 'user',
      content: userContent,
    },
  ];

  const completion = await openai.chat.completions.create({
    model: 'gpt-4o-2024-08-06', // или gpt-4o-mini, оба поддерживают Structured Outputs:contentReference[oaicite:2]{index=2}
    messages,
    response_format: receiptResponseFormat,
  });

  const message = completion.choices[0].message;

  if (!message.content || typeof message.content !== 'string') {
    throw new Error('Empty structured output from model');
  }

  const parsed = JSON.parse(message.content) as ReceiptExtraction;

  return parsed;
}
```

После этого в твоём коде нормализация может выглядеть так же, как ты писал в описании:

```ts
export function normalizeReceipt(extraction: ReceiptExtraction) {
  let confidence = extraction.receipt_confidence;
  let amount = extraction.result.amount ?? null;

  // clamp [0,1]
  confidence = Math.max(0, Math.min(1, confidence));

  if (!extraction.is_receipt) {
    return {
      ...extraction,
      receipt_confidence: confidence || 0.1,
      result: {
        ...extraction.result,
        amount: null,
      },
    };
  }

  if (extraction.is_receipt && amount != null && confidence === 0) {
    confidence = 0.85;
  }

  return {
    ...extraction,
    receipt_confidence: confidence,
  };
}
```

---

## 4. Вариант с Zod и авто-парсингом (Node helper)

Если хочешь, чтобы SDK сам конвертировал Zod → JSON Schema и сразу парсил ответ, можно использовать `beta.chat.completions.parse` и `zodResponseFormat`.([OpenAI Cookbook][1])

```ts
import OpenAI from 'openai';
import { z } from 'zod';
import { zodResponseFormat } from 'openai/helpers/zod';

const openai = new OpenAI();

const ReceiptSchema = z.object({
  thinking: z.string(),
  is_receipt: z.boolean(),
  receipt_confidence: z.number().min(0).max(1),
  result: z.object({
    amount: z.number().nullable(),
    currency: z
      .enum(['RUB', 'USD', 'EUR', 'KZT', 'BYN'])
      .nullable(),
    date_time: z.string().nullable(),
    merchant: z.string().nullable(),
    purpose: z.string().nullable(),
    operation_id: z.string().nullable(),
    payer_account: z.string().nullable(),
  }),
});

type ReceiptExtraction = z.infer<typeof ReceiptSchema>;

export async function analyzeReceiptZod(
  input: AnalyzeReceiptInput,
): Promise<ReceiptExtraction> {
  const userContent: any[] = [];
  if (input.text) userContent.push({ type: 'text', text: input.text });
  if (input.imageUrl)
    userContent.push({
      type: 'image_url',
      image_url: { url: input.imageUrl },
    });

  const completion = await openai.beta.chat.completions.parse({
    model: 'gpt-4o-2024-08-06',
    messages: [
      {
        role: 'system',
        content:
          'You are a receipt extraction engine. Decide whether the input is a receipt and extract its fields.',
      },
      { role: 'user', content: userContent },
    ],
    response_format: zodResponseFormat(ReceiptSchema, 'receipt_extraction'),
  });

  const msg = completion.choices[0].message;
  if (!msg.parsed) throw new Error('No parsed structured output');
  return msg.parsed;
}
```

---

## 5. Отвечая на твой прямой вопрос

> I am looking for code that does structured receipt extraction with model-reported “is receipt?” confidence, is there existing code that can do this?

В коробке такого специального метода нет, но **ровно этот функционал** и есть типовой кейс Structured Outputs:

* JSON Schema (или Zod/Pydantic-модель) → `response_format` / `zodResponseFormat`.
* Модель гарантированно возвращает JSON по этим полям.
* В схеме мы явно закладываем `is_receipt` и `receipt_confidence` и дальше уже играем порогами на своём уровне (0.3–0.5 для авто-создания).

Если хочешь, могу следующим шагом помочь вписать это конкретно в твой `AIService.analyzeReceipt` / `safeExtractPdfText` (под существующую архитектуру LeadForgeAI).

[1]: https://cookbook.openai.com/examples/structured_outputs_intro "Introduction to Structured Outputs"
```

